import React from "react";

import classes from "./Notes.module.css";

const Notes = (props) => {
  return (
    <div className={classes.Notes}>
      {props.notes.map((item) => {
        return <p>{item.title}</p>;
      })}
    </div>
  );
};

export default Notes;
